import axios from 'axios';
import {getBooksUrl} from "./AppVariables";

export const del = (userName,password,Id)=>{
  axios.delete(getBooksUrl()+"/"+Id,{
    auth: {
    username: userName,
    password: password
  }
  })
      .then(res => {
        alert("Id: "+Id+" Silindi");
        return true;
      })
      .catch(error => {
        alert("Silme başarısız Id: "+Id+" bulunmadı");
        return false;
      });
}
